var JBox = function (object) {
    this.keydown = function (evt) {
        if (evt.keyCode === 27 || evt.keyCode === 13) {
            window.removeEventListener('keydown', this.keydown, false);
            JBox.fechar();
        }
    };
    this.fechar = function (evt) {
        var jbox = document.getElementsByClassName('jBox')[0];
        jbox.classList.remove('jBox_visivel');
        setTimeout(function () {
            jbox.remove();
        }, 400);
        window.removeEventListener('keydown', this.keydown, false);
    };
    JBox.fechar = this.fechar;
    this.html = '<div class="jBox_wrapper"><div class="jBox_fundo"></div><div class="jBox_box"><div class="jBox_icone"><span class="fa {jBox_icone}"></span></div><div class="jBox_texto">{jBox_mensagem}</div><div class="jBox_botao">{jBox_botao}</div></div></div>';
    this.html_botao = '<a class="{jBox_icone} jBox_botao_acao jBox_botao_{jBox_ref_botao}" href="javascript:void(0)">{jBox_botao}</a>';
    this.icones = {"aviso": "jBox_aviso fa-exclamation-circle", "sucesso": "jBox_sucesso fa-check-circle", "erro": "jBox_erro fa-times-circle", "pergunta": "jBox_pergunta fa-question-circle"};
    this.icone_personalizado = false;
    this.icone_utilizar = "aviso";
    this.mensagem = "";
    this.botoes = {'ok': "Ok"};
    this.acoes = {'ok': this.fechar};
    this.definir = function () {
        var html_botoes = [];
        if (object) {
            this.icone_utilizar = (typeof object["icone_utilizar"] !== "undefined" ? object["icone_utilizar"] : "aviso");
            this.icone_personalizado = (typeof (object.icone_personalizado !== "undefined") ? object.icone_personalizado : false);
            this.mensagem = (typeof object.mensagem == "object" ? object.mensagem.join("<br/>") : (typeof object.mensagem === "string" ? object.mensagem.toString() : ""));
            this.botoes = (typeof object['botoes'] !== "undefined" ? object['botoes'] : this.botoes);
            this.acoes = (typeof object['acoes'] !== "undefined" ? object['acoes'] : this.acoes);
        }

        this.html = this.html.replace("{jBox_mensagem}", this.mensagem);
        this.html = this.html.replace("{jBox_icone}", (this.icone_personalizado ? this.icone_personalizado : this.icones[this.icone_utilizar]));
        var html_botao = this.html_botao.replace("{jBox_icone}", (this.icone_personalizado ? this.icone_personalizado : this.icones[this.icone_utilizar]));
        for (var i in this.botoes) {
            var bot = html_botao;
            bot = bot.replace("{jBox_ref_botao}", i);
            bot = bot.replace("{jBox_botao}", this.botoes[i]);
            html_botoes.push(bot);
        }

        this.html = this.html.replace("{jBox_botao}", html_botoes.join(""));
        var div = document.createElement('div');
        div.classList.add('jBox');
        div.innerHTML = this.html.trim();
        document.getElementsByTagName('body')[0].appendChild(div);
        for (var i in this.acoes) {
            var ac = this.acoes[i];
            document.getElementsByClassName('jBox_botao_' + i + '')[0].addEventListener("click", ac);
        }
        window.addEventListener('keydown', this.keydown);
        setTimeout(function () {
            document.getElementsByClassName("jBox")[0].classList.add('jBox_visivel');
        }, 100);
        document.getElementsByClassName("jBox_botao_acao")[0].focus();
    };
    this.definir();
};

function msg(messages) {
    if (typeof messages === "object") {
        messages = messages.join('<br/>');
    }
    new JBox({
        mensagem: messages
    });
}
function pergunta(messages, location = false) { // window.location
    if (typeof messages === "object") {
        messages = messages.join('<br/>');
    }
    new JBox({
        mensagem: messages,
        botoes: {'ok': "Ok", 'cancelar': "Cancelar"},
        acoes: {
            "ok": function () {
                if (location) {
                    window.location.href = location;
                } else {
                    JBox.fechar();
                }
            },
            "cancelar": function () {
                JBox.fechar();
            }
        },
        icone_utilizar: "pergunta",
    });
}
function sucesso(message, location = false) { // mensagem de sucesso
    new jBox({
        mensagem: message,
        acoes: {"ok": function () {
                JBox.fechar();
                if (location) {
                    window.location = location.toString();
                } else {
                    window.history.back(-1);
                }
            }
        },
        icone_utilizar: "sucesso",
    });
}

function erro(message, location = false) { // mensagem de erro
    new jBox({
        mensagem: message,
        acoes: {"ok": function () {
                JBox.fechar();
                if (location) {
                    window.location = location.toString();
                } else {
                    window.history.back(-1);
                }
            }
        },
        icone_utilizar: "erro",
    });
}


function carregamento(evt) { // faz todos os formulários obrigatorios não serem enviados antes do jQuery carregar.
    evt.preventDefault();
}


function validaEmail(email) { // valida se o email informado é válido
    usuario = email.substring(0, email.indexOf("@"));
    dominio = email.substring(email.indexOf("@") + 1, email.length);
    if ((usuario.length >= 1) && (dominio.length >= 3) && (usuario.search("@") === -1) && (dominio.search("@") === -1) && (usuario.search(" ") === -1) && (dominio.search(" ") === -1) && (dominio.search(".") !== -1) && (dominio.indexOf(".") >= 1) && (dominio.lastIndexOf(".") < dominio.length - 1)) {
        return true;
    } else {
        return false;
    }
}

function validaCPF(cpf) {
    if (/[0-9]{3}\.[0-9]{3}\.[0-9]{3}\-[0-9]{2}/.test(cpf)) { // valida se o CPF informado é válido
        return true;
    } else {
        return false;
    }
}

function validaCNPJ(cnpj) {
    if (/[0-9]{2}\.[0-9]{3}\.[0-9]{3}\/[0-9]{4}\-[0-9]{2}/.test(cnpj)) { // valida se o CNPJ informado é válido
        return true;
    } else {
        return false;
    }
}

function validaCEP(cep) {
    if (/[0-9]{2}\.[0-9]{3}\-[0-9]{3}/.test(cep)) { // valida se o CEP informado é válido
        return true;
    } else {
        return false;
    }
}

function validaURL(url) { // valida se a URL informada é válida
    if (/(http(s)?\:\/\/)?(www\.)?([a-zA-Z0-9]+\.[0-9a-zA-Z]{2,})([a-zA-Z0-9]{2,})?/.test(url)) {
        return true;
    } else {
        return false;
    }
}


function delegar() { // faz os binds para os formulários obrigatorios
    var forms = document.getElementsByTagName('form');
    for (var i = 0; i < forms.length; i++) {
        var form = forms[i];
        var validar = (form.getAttribute("validar") === 'ok');
        form.removeEventListener("submit", carregamento, false);
        if (validar) {
            form.addEventListener('submit', function (evt) {
                form = this;
                var mensagens = [];
                var inputs = [];
                var elms = form.getElementsByTagName('input');
                for (var inp = 0; inp < elms.length; inp++) {
                    var input = elms[inp];
                    var validar = (input.getAttribute('obrigatorio') !== null || input.getAttribute("obrigatorio_funcao") !== null || input.getAttribute('qde_min') !== null || input.getAttribute('minimo') !== null);
                    if (validar) {
                        inputs.push(input);
                    }
                }
                var elms = form.getElementsByTagName('select');
                for (var inp = 0; inp < elms.length; inp++) {
                    var input = elms[inp];
                    var validar = (input.getAttribute('obrigatorio') !== null || input.getAttribute("obrigatorio_funcao") !== null || input.getAttribute('qde_min') !== null || input.getAttribute('minimo') !== null);
                    if (validar) {
                        inputs.push(input);
                    }
                }
                var elms = form.getElementsByTagName('textarea');
                for (var inp = 0; inp < elms.length; inp++) {
                    var input = elms[inp];
                    var validar = (input.getAttribute('obrigatorio') !== null || input.getAttribute("obrigatorio_funcao") !== null || input.getAttribute('qde_min') !== null || input.getAttribute('minimo') !== null);
                    if (validar) {
                        inputs.push(input);
                    }
                }
                for (var inp = 0; inp < inputs.length; inp++) {
                    var input = inputs[inp];
                    var tipo = (input.getAttribute("type") !== null ? input.getAttribute("type") : (input.tagName == 'SELECT' ? "select" : (input.tagName == 'TEXTAREA' ? "textarea" : "undefined")));
                    var obrigatorio_mensagem = input.getAttribute('obrigatorio');
                    var obrigatorio_mensagem_false = false;
                    var obrigatorio_funcao = input.getAttribute('obrigatorio_funcao');
                    var qde_min = parseInt(input.getAttribute('qde_min'));
                    var checkbox_grupo = input.getAttribute('obrigatorio_grupo');
                    if (obrigatorio_funcao !== null) {
                        var auxiliar_funcao = obrigatorio_funcao.split(',');
                        obrigatorio_funcao = auxiliar_funcao[0].replace("/\ /", "");
                        auxiliar_funcao = auxiliar_funcao[1].split("|");
                        obrigatorio_mensagem = auxiliar_funcao[0].replace("/\ /", "");
                        obrigatorio_mensagem_false = auxiliar_funcao[1].replace("/\ /", "");
                        delete auxiliar_funcao;
                    }
                    if (tipo !== "undefined" && (tipo === "text" || tipo === "email" || tipo === "url" || tipo === "tel" || tipo === "password" || tipo === "hidden" || tipo === "textarea")) { //aplica validação para campos que recebem texto
                        var valor = input.value;
                        var minimo = (typeof input.getAttribute('minimo') !== "undefined" ? input.getAttribute('minimo') : false);
                        if (!minimo) {
                            if (valor === "" || valor.length < 3) {
                                mensagens.push(obrigatorio_mensagem);
                            } else {
                                if (obrigatorio_funcao) {
                                    if (typeof window[obrigatorio_funcao]) {
                                        if (!window[obrigatorio_funcao].apply(null, [valor])) {
                                            input.value = "";
                                            mensagens.push(obrigatorio_mensagem_false);
                                        }
                                    }
                                }
                            }
                        } else {
                            if (!valor.length > parseInt(minimo)) {
                                mensagens.push(obrigatorio_mensagem);
                            }
                        }
                    }
                    if (tipo == "select") {
                        var obrigatorio = (input.options[input.options.selectedIndex].getAttribute('ignorar') !== null || input.options[input.options.selectedIndex].getAttribute('disabled') !== null || input.options[input.options.selectedIndex].value == "");
                        if (obrigatorio) {
                            mensagens.push(obrigatorio_mensagem);
                        }
                    }
                    if (tipo == "radio" || tipo == "checkbox") {
                        var nome = input.getAttribute('name').replace(/\[.*/, "");
                        if (tipo == "radio") {
                            var checados = 0;
                            var dentro_mensagem = false;
                            for (var c = 0; c < inputs.length; c++) {
                                var d = inputs[c];
                                if (d.getAttribute('type') == tipo) {
                                    var check = d.getAttribute('name').replace("/[^!" + nome + "]/", "");
                                    if (check == nome) {
                                        if (d.checked) {
                                            checados++;
                                        }
                                    }
                                }
                            }
                            for (var e = 0; e < mensagens.length; e++) {
                                if (mensagens[e] === obrigatorio_mensagem) {
                                    dentro_mensagem = true;
                                }
                            }
                            if (!dentro_mensagem && checados == 0) {
                                mensagens.push(obrigatorio_mensagem);
                            }
                        }
                        if (tipo === "checkbox") {
                            var checados = 0;
                            var dentro_mensagem = false;
                            for (var x = 0; x < inputs.length; x++) {
                                var checkbox = inputs[x];
                                if (checkbox.getAttribute('type') == tipo) {
                                    if (checkbox.checked) {
                                        if (checkbox_grupo !== null) {
                                            if (checkbox_grupo == checkbox.getAttribute('obrigatorio_grupo')) {
                                                checados++;
                                            }
                                        } else {
                                            checados++;
                                        }
                                    }
                                }
                            }
                            for (var z = 0; z < mensagens.length; z++) {
                                if (mensagens[z] == obrigatorio_mensagem) {
                                    dentro_mensagem = true;
                                }
                            }
                            if (checados < qde_min && !dentro_mensagem) {
                                mensagens.push(obrigatorio_mensagem);
                            }
                        }
                    }
                }
                if (mensagens.length > 0) {
                    msg(mensagens);
                    evt.preventDefault();
                    return false;
                } else {
                    form.classList.add('validado');
                    return true;
                }
            });
        }
    }
}

function carregamento(evt) { // faz todos os formulários obrigatorios não serem enviados antes do jQuery carregar.
    evt.preventDefault();
}

document.addEventListener("DOMContentLoaded", function () {
    var forms = document.getElementsByTagName('form');
    for (var i = 0; i < forms.length; i++) {
        var form = forms[i];
        var validar = form.getAttribute('validar');
        if (validar == "ok") {
            form.addEventListener("submit", carregamento);
            delegar();
        }
    }
});

if (typeof jQuery == "function") {
    $.prototype.chaveSeguranca = function (recarregar = false, elm = false) {
        if (recarregar) {
            $(this).html("");
            var a = elm;
            var style = elm.getAttribute("style");
            style = style.split(";transition");
            a.setAttribute("style", style + ";transition:ease-in-out 0.4s; transform:rotate(180deg)");
            setTimeout(function () {
                style = a.getAttribute("style").split(";transition");
                a.setAttribute("style", style[0]);
            }, 400);
        }
        var fundos = [
            "data:image/jpeg;base64,",
            "data:image/jpeg;base64,",
            "data:image/jpeg;base64,",
            "data:image/jpeg;base64,",
            "data:image/jpeg;base64,"
        ];
        var html = "<div style='border-radius:5px;padding-left:35px; margin:1px 0;width:145px;height:34px;position:relative;display:block;background-image:url(\"" + fundos[ Math.floor((Math.random() * (fundos.length)))] + "\");background-repeat:repeat'>{chaveSeguranca}</div>";
        var div = document.createElement('div');
        var html_letra = '<span style="{style}">{character}</span>';
        var chave = Math.random().toString(36).substring(2, 5) + Math.random().toString(36).substring(2, 5);
        var characters = [];
        for (var i = 0; i < chave.length; i++) {
            var style = [
                "color: #" + Math.floor(Math.random() * 16777215).toString(16),
                "transform: rotate(" + (Math.floor(Math.random() * (-15 - 15) + 15)) + "deg) translate(" + (Math.floor(Math.random() * (-30 - 30) + 30)) + "%, " + (Math.floor(Math.random() * (-15 - 15) + 15)) + "%)",
                "float:left",
                "line-height:34px",
                "display:inline-block",
                "position:relative",
                "margin:0 3px",
                "font-size:20px",
                "font-weight:bold",
                "text-shadow:0 0 2px rgba(0,0,0,0.4)"
            ];
            var elm = html_letra.replace("{style}", style.join(";"));
            elm = elm.replace("{character}", chave[i]);
            characters.push(elm);
        }
        html = html.replace("{chaveSeguranca}", characters.join(''));
        div.innerHTML = html;
        $(div).appendTo(this);
        var d = new Date();
        d.setTime(d.getTime() + (1 * 24 * 60 * 60 * 1000));
        document.cookie = "chaveSeguranca=" + chave + ";expires=" + d.toUTCString() + ";path=/";
    };
}